import React from 'react'

const CartList = ({Cart}) => {
    
  return (
    <div>
        {Cart.map((data,index)=>{
            return(
             <div key={index}>
                <img src={data.url} alt="" width={40} />
                <span>{data.name}</span>
                <button>-</button>
                <span>{data.quantity}</span>
                <button>+</button>
                <span>{data.price}</span>
             </div>
            )
        })}
        <span>total{data.price}</span>
    </div>
  )
}

export default CartList
